import React, { Component } from "react";
import './App.css';
import Home from './Components/Home';


import { BrowserRouter as Router, Route, Switch, Link, Redirect } from "react-router-dom";


class App extends Component {
    render() {
        return (
            <Router>
            <div className="App">
                <Home />
               
                             
                </div>
            </Router>

        );
    }
}

export default App;
